import React, { useEffect, useState } from "react";
import axios from "axios";
import {
    MDBCard,
    MDBCardHeader,
    MDBCardBody,
    MDBCardTitle,
    MDBCardText,
    MDBBtn
  } from 'mdb-react-ui-kit';  

function Viewbook(){
    const [viewapp,setViewapp] = useState([]);
    useEffect(() => {
      axios
        .get("/view_app")
        .then((response) => {
         setViewapp(response.data); 
        })
        .catch((error) => {
          console.log(error);
        });
    }, []);

    return(
     <div className="App mt-4">
        
        {viewapp.map((slots) => (
            <div key={slots._id}>
    <MDBCard background="light" className="mt-2" shadow="0" border="dark">
      <MDBCardHeader>
        <h3>Appointment Details: </h3><p>Date: {slots.date} , At: {slots.start_time}, Duration: 30 minutes</p>
        <br></br>
        <h4>Doctor Name:</h4> {slots.username}
      </MDBCardHeader>
      <MDBCardBody>
                  <MDBCardTitle><p>Meeting Link: {slots.meeting_url}</p></MDBCardTitle>
                  <MDBCardText><p>Meeting Password: {slots.meeting_pass}</p></MDBCardText>
                  <MDBBtn href={slots.meeting_url}>Join</MDBBtn>
                </MDBCardBody>
    </MDBCard>
    </div>
        ))}
     </div>
    );
}
export default Viewbook
